import React from 'react'
import Buddy from './buddy'

function BuddyList() {
    let arr  = [1,2,3]
    return (
        <div className="buddyList">
            {arr.map((e,index) => <Buddy key={index}/>)}
            <div className="back">
                <i className='iconfont icon-jiantou'></i>
            </div>
            <style jsx>
                 {`
                 .buddyList{
                  width:30vw;
                  height:100%;
                  background:#f7f5fb;
                  position:fixed;
                  right:0;
                  top:0;
                  z-index:99;
                  padding:4vh 4vh;
                }
                .back {
                    position:absolute;
                    left:2px;
                    top:50%;
                    transform:translateY(-50%);
                }
                i {
                    font-size:2rem;
                    
                }
                i:hover {
                    font-size:2.5rem;
                    background:#72BDE8;
                    border-radius:50%;
                }
                 `}
            </style>
        </div>
    )
}

export default BuddyList
